class Node:    def __init__(self, data):        self.data_ = data        self.next_ = Noneclass LinkedList:    def __init__(self):        self.linkedlist = []        self.count = 0    def insert(self, value):        if(self.count == 0):            temp = Node(value)            self.linkedlist.append({'data': temp.data_, 'next': None})        else:                address = Node(value)            self.linkedlist[-1]['next'] = address            print(self.linkedlist[-1]['next'])            self.linkedlist.append({'data': Node(value).data_, 'next': None})        print(self.linkedlist)        self.count = self.count + 1node = Node(3)print(node.data_)print(node.next_)print('-----------')linkedlist = LinkedList()print(linkedlist.insert(9))print(linkedlist.insert(19))print(linkedlist.insert(119))print(linkedlist.insert(91))print(linkedlist.insert(911))